import React from 'react';
import Logo from '../../images/landing.svg';

export default function Landing(){
    return(
        <div className="content" >
            <header>
                <img src={Logo} alt="landing"></img>
            </header>
            <main>
                <h1>Bem vindo ao PDV!</h1>
            </main>
            <footer>bem vindo ao footer</footer>

        </div>
    );
}
